  \"2013-03-14T19:50:00.500168\",\n\t\"name\": \"kansas-satellite-image-database-ksid-2004-2005\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Kansas Satellite Image Database (KSID)
  2004-2005 consists of terrain-corrected, precision rectified spring, summer, and
  fall Landsat 5 Thematic Mapper (TM) imagery covering the state of Kansas that has
  been tiled by county and is in GeoTiff format. Although some county triplicates
  date wholly from either 2004 or 2005, some county triplicates were constructed using
  imagery from both 2004 and 2005. The KSID: 2004-2005 consists of raw data and visual
  products. The raw dataset consists of the seven geometrically corrected Landsat
  5 bands in their original units (DN values). The visual dataset consists of three
  products: Normalized Difference Vegetation Index (NDVI) images, false- color infrared
  composites, and resolution-enhanced natural color composites.\",\n\t\"license_title\":
